ico la liga para la conexión a dicho evento. \n\n4.- El día 23 de septiembre del presente año, se realizaron las gestiones con la Coordinación de Comunicación Social y Relaciones Públicas del TECDMX, para poder llevar a cabo la novena sesión de las “Pláticas de Campaña de Salud 2022”, con verificativo el 30 de septiembre del año en curso, misma que se realiza en el marco del Programa Institucional ActivaTECDMX, asimismo, en fecha 29 de septiembre de 2022 esta Coordinación compartió la liga de conexión, escaleta y ficha técnica, en seguimiento a la solicitud de colaboración presentada por el Instituto de Formación y Capacitación el 6 de enero del año en curso para que esta Coordinación apoye en las actividades de difusión, atención y seguimiento de dicho programa. \n5.- El 29 de septiembre del año en curso, se solicitó a diversas instituciones la difusión de la actividad “Charlas de Café”, correspondiente a la programación del mes de septiembre, en seguimiento a la instrucción derivada del Acuerdo Plenario de fecha 27 de enero de 2021 por medio del cual las Magistraturas aprobaron la propuesta de la iniciativa.\n6. En fecha 30 de septiembre se recibió determinación de las Magistraturas respecto a la propuesta que para que la Coordinación de Vinculación y Relaciones Internacionales funja como enlace con el Instituto Electoral de la Ciudad de México, a efecto de que el TECDMX acompañe los trabajos del IECM relativos al Protocolo de Consulta a Pueblos y Barrios Originarios y Comunidades Indígenas y Afromexicanas de la Ciudad de México en Materia Electoral y Participación Ciudadana de 04 de marzo de 2022.', `porcentaje` = NAN, `porcentaje_real` = NAN
